import { FaFile, FaFileAlt, FaFirstOrderAlt, FaJediOrder, FaUser, FaUserAlt, FaUserAltSlash } from "react-icons/fa";
import Card from "../components/UI/Card";
import "./Dashboard.css";

const Dashboard = () => {
  // Table column options
  const columns = [
    {
      name: "ID User",
      selector: (row) => row.user,
    },
    {
      name: "Year",
      selector: (row) => row.year,
    },
  ];

  // Render component
  return (
    <div className="dashboard px-3 py-5">
      <h5>Dashboard</h5>
      <Card className="mt-3 d-flex">
        <div className="dashboard-item">
          <div>
            <h3>2</h3>
            <div>Clients</div>
          </div>
          <FaUserAlt fontSize="1.5rem" color="gray" />
        </div>
        <div className="dashboard-item">
          <div>
            <h3>32</h3>
            <div>Number of orders</div>
          </div>
          <FaFileAlt fontSize="1.5rem" color="gray" />
        </div>
        <div className="dashboard-item">
          <div>
            <h3>32.220.000 VND</h3>
            <div>Earning of month</div>
          </div>
          <FaFileAlt fontSize="1.5rem" color="gray" />
        </div>
        <div className="dashboard-item">
          <div>
            <h3>30.110.600 VND</h3>
            <div>Average earning</div>
          </div>
          <FaFileAlt fontSize="1.5rem" color="gray" />
        </div>
      </Card>
      <Card className="mt-4 p-3">
        <h5>History</h5>
      </Card>
    </div>
  );
};

export default Dashboard;
